            <p>Steam Games News App is a react project used to fetch and display news related to steam games. It allows users to search for games and view their latest updates in a modal interface.</p>
            <br></br>
            <p>If you want to open project localy, then after downloading you have to:</p>
            <p>1. Run the server by typing "node server.js" in terminal</p>{/*list without using <ol> because why not*/}
            <p>2. Run the server by typing "node server.js" in terminal</p>
        </div>
    )
}
